export const initialState = {
    userInfo: null,
    isLoggingIn: false,
    isLoggingOut: false,
    isLogged:false,
    loginErrorReason: '',
    signedUp: false,
    isSigningUp: false,
    signUpErrorReason: '',
};

const reducer = (state=initialState , action) => {
    switch(action.type){
        default:{
            return{
                ...state,
            }
        }
    }
}

export default reducer;
